import React from "react";
import about from "../../assests/aboutus.jpg";

const About = () => {
  return (
    <div className="h-full w-full">
      <div className="flex h-[115px] w-full bg-[#F0F0F0]">
        <h1 className="text-[30px] uppercase py-[20px] text-[#777777] tracking-widest font-bold leading-[60px]">
          About Us
        </h1>
        <div className="">
          <span className="text-[14px] text-[#777777] tracking-widest">
            About Us / <span className="text-[#FF004F]">Home</span>
          </span>
        </div>
      </div>
      <img src={about} alt="About Us" />
    </div>
  );
};

export default About;
